// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.7.0;

import "../authority/Member.sol";

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

/**
 * @title Dragon Ball Fighter Z Token - ERC20
 *
 * It's mainly used for pledge to get M3T Token
 * QUANTITIES: 2 MILLION | DECIMALS: 18
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-3-28 | VERSION: v1.0.2
 */
contract Token is Member, ERC20 {
    using SafeMath for uint256;

    string[]  private _transfer_recipients = [
        "FOUND", "EXTENSION", "BLACKHOLE"
    ];

    uint256[] private _transfer_rate = [5, 3, 2];
    mapping (address => bool) private _white_list;

    constructor(address auth_) Member(auth_)
        ERC20("Dragon Ball", "DBFZ") {

        uint256 decimal = (10 ** uint256(decimals()));
        _mint(msg.sender, 10e8 * decimal);

        _white_list[msg.sender] = true;
    }

    function _do_transfer(
        address sender_, address recipient_, uint256 amount_
    ) private {
        if (_white_list[sender_] == false) {
            uint256 other_amount = amount_.mul(10).div(100);

            for (uint i = 0; i < _transfer_rate.length; i++) {
                string memory name = _transfer_recipients[i];
                address recipient = authority.members(name);
                uint256 item = other_amount.mul(_transfer_rate[i]);

                _transfer(sender_, recipient, item.div(100));
            }

            uint256 real_amount = amount_.sub(other_amount);
            _transfer(sender_, recipient_, real_amount);
        } else {
            _transfer(sender_, recipient_, amount_);
        }
    }

    function transfer(address recipient, uint256 amount) public
        virtual override returns (bool success) {

        _do_transfer(_msgSender(), recipient, amount);
        success = true;
    }

    function transferFrom(
        address sender, address recipient, uint256 amount
    ) public virtual override returns (bool success) {

        _do_transfer(sender, recipient, amount);
        success = true;
    }

    function setTransferRate(uint index, uint rate) public
        CheckPermit("CONFIG") {

        _transfer_rate[index] = rate;
    }

    function setWhiteList(address target, bool enable) public
        CheckPermit("CONFIG") {

        _white_list[target] = enable;
    }
}

